import React from 'react';

const Box = (props) => {
    console.log("props : " , props)
    return (
            <div style={{width:200+'px',height:200+'px',backgroundColor:props.color}} onClick={()=>props.delBoxFun(number)}>
            {props.number}
            </div>  
    );
    }

export default Box
